            </div>
            <footer className='home-footer'>
                <Link to='/home'><img src={homeImg} className='home-img' /></Link>
                <Link to='#'><img src={profileImg} className='home-img' /></Link>
                <Link to='#'><img src={writeImg} className='home-img' /></Link>
